queryParams.description:
This parameter helps you restrict the result either by mentioning a bounded area or to certain eloc (6 digit code to any poi, locality, city, etc.). This optional parameter & its related effect on response is not applicable for regions apart from India (IND). Below mentioned are the available types:

filter = pin:It takes pincode/postal code of an area{e.g. filter=pin:110055}
filter = bounds lat1,lng1;lat2,lng2(latitude,longitude){e.g. filter=bounds 28.598882, 77.212407; 28.467375, 77.353513}
filter = cop {eloc} (string) {e.g. filter=cop:YMCZ0J}
Example : pin:110001

